    return (
        <header className="header">
            <div className="header-content">
                <h1 className="header-title">Helpdesk System</h1>
                <div className="user-info">
                    <span className="user-name">Welcome, Admin</span>
                </div>
            </div>
        </header>
    );
};

export default Header;
